import React from 'react'
import { Route , Link } from 'react-router-dom';

class header extends React.Component {
    render() {
        return (
            <div>
                <ul>
                    <Link to='/to'>흐흐</Link>
                    <Link to='/about'>크크</Link>
                </ul>
            </div>
        )
    }
}

export default header;
